import React, { useState } from 'react'
import {Form,Button} from 'react-bootstrap'
import { useDispatch, useSelector } from 'react-redux'
import FormContainer from '../Components/FormContainer'

const ShippingScreen = () => {

    const [address,setAddress] = useState('');
    const [city,setCity] = useState('');
    const [postalCode,setPostalCode] = useState('');
    const [country,setCountry] = useState('')

    const submitHandler = (e) => {
        e.defaultPrevent();
        console.log("Shippiing")
    }

  return (
    <FormContainer>
        <h1>Shipping</h1>
        <Form onSubmit={submitHandler}>
            <Form.Group className="formGroup" controlId="address">
            <Form.Label>Address</Form.Label>
            <Form.Control
                type="address"
                placeholder="Enter Address"
                value={address}
                onChange={(e) => setAddress(e.target.value)}
            ></Form.Control>
            </Form.Group>

            <Form.Group className="formGroup" controlId="city">
            <Form.Label>City</Form.Label>
            <Form.Control
                type="city"
                placeholder="Enter City"
                value={city}
                onChange={(e) => setCity(e.target.value)}
            ></Form.Control>
            </Form.Group>

            <Form.Group className="formGroup" controlId="postalCode">
            <Form.Label>Postal Code</Form.Label>
            <Form.Control
                type="postalCode"
                placeholder="Enter Postal Code"
                value={postalCode}
                onChange={(e) => setPostalCode(e.target.value)}
            ></Form.Control>
            </Form.Group>

            <Form.Group className="formGroup" controlId="country">
            <Form.Label>Country</Form.Label>
            <Form.Control
                type="country"
                placeholder="Enter Country"
                value={country}
                onChange={(e) => setCountry(e.target.value)}
            ></Form.Control>
            </Form.Group>
            
        </Form>

        <Button type='submit' variant='primary' >
            Continue
        </Button>

    </FormContainer>
  )
}

export default ShippingScreen
